text:
@Calleri é fato que São Paulo é o Estado que tem mais representantes de alto nível no futebol, porém, quando enfrentam adversários como Flamengo, Atlético MG, Fluminense, Internacional... Antes tinha Grêmio e Cruzeiro

Não existe uma desigualdade ou uma disparidade de um time pro outro... É confronto igual, é pressão igual, são camisas pesadas igual, jogadores de alto nível igual

O futebol Brasileiro é o mais competitivo do mundo, exatamente pelo número de times grandes, da pressão e do impacto midiático que tem... Agora São Paulo é o único que se sente superior
